import React from 'react'
import Headroom from "react-headroom"

const Header = () => {
    return (
        <Headroom disableInlineStyles="true">
            <Nav.Item>
                <Nav.Link>Active</Nav.Link>
            </Nav.Item>
        </Headroom>
    )
}

export default Header
